//validate if signer's are users in DocuSign
if (global.GrcReportGenerator.validate(current) != "") {
    workflow.scratchpad.needDocuSignAccount = "true";
    //logs error message returned by validate function with information of signers that are not users in DocuSign.
    workflow.info(global.GrcReportGenerator.validate(current));
} else {
    workflow.scratchpad.needDocuSignAccount = "false";
}

